import './App.css';
import Header from './components/Header.js';
import Body from './components/Body.js';
import Freecase from './components/Freecase.js';
import Commmoncase from './components/Commoncase.js';
function App() {
  return (
    <div className="content">
      <Header></Header>
      <Freecase></Freecase>
      <Commmoncase></Commmoncase>
      <Body></Body>
    </div>
  );
}

export default App;
